void draw_plane_propeller(FrameBuffer& fb, int x, int y, float size, int position, Warna* color) {
    int point[28][2];
    int x_shifted, y_shifted;
    double angle = 0.0;


    // Horizontal Line
    for (int i = 0; i < 7; i++) {
        // X
        point[i][0] = x - (size * 25);
        point[i+7][0] = x + (size * 25);

        //Y
        point[i][1] = y - (i - 3);
        point[i+7][1] = point[i][1];
    }

    // Vertical Line
    for (int i = 0; i < 7; i++) {
        // X
        point[i+14][0] = x - (i - 3);
        point[i+21][0] = point[i+14][0];

        //Y
        point[i+14][1] = y - (size * 25);
        point[i+21][1] = y + (size * 25);
    }

    for (int i = 0; i < 28; i++) {
        x_shifted = point[i][0] - x;
        y_shifted = point[i][1] - y;
        if (position == 1) {
            angle = 30.0;
        } else if (position == 2) {
            angle = 60.0;
        }
        point[i][0] = x + (x_shifted * cos(angle * PI / 180)) - (y_shifted * sin(angle * PI / 180));
        point[i][1] = y + (x_shifted * sin(angle * PI / 180)) + (y_shifted * cos(angle * PI / 180));
    }

    for (int i = 0; i < 7; i++) {
        draw_line(fb, point[i][0], point[i][1], point[i+7][0], point[i+7][1], color);
    }

    for (int i = 14; i < 21; i++) {
        draw_line(fb, point[i][0], point[i][1], point[i+7][0], point[i+7][1], color);
    }
}

