void draw_bullets(FrameBuffer& fb, int x, int y, float size, Warna* color) {
    int line[5][4] = {
        {x-(size*10), y-(size*10), x-(size*10), y+(size*10)}, {x-(size*10), y+(size*10), x+(size*10), y+(size*10)},
        {x+(size*10), y+(size*10), x+(size*10), y-(size*10)}, {x+(size*10), y-(size*10), x, y-(size*20)},
        {x, y-(size*20), x-(size*10), y-(size*10)}
    };

    int minX,minY,maxX,maxY;
    maxX = minX = line[0][0];
    maxY = minY = line[0][1];
    // find reference point;
    for (int i = 1; i < 5; i++) {
        minY = min(minY, min(line[i][1],line[i][3]));
        minX = min(minX, min(line[i][0],line[i][2]));
        maxY = max(maxY, max(line[i][1],line[i][3]));
        maxX = max(maxX, max(line[i][0],line[i][2]));
    }
    int sizeRow = maxY - minY + 1;
    int sizeCol = maxX - minX + 1;

    Matriks map(sizeRow,sizeCol);
    for (int i = 0; i < 5; i++) {
       point_draw_line(map, line[i][0]-minX, line[i][1]-minY, line[i][2]-minX, line[i][3]-minY);
    }
    Word::floodFill(map,x+(size*10)-minX-1,y+(size*10)-minY-1);
    for (int i = 0; i < map.getRow(); i++)
        for (int j = 0; j < map.getCol(); j++) {
            if (map.getVal(j,i) == 1){
                fb.draw_point(minX+j,minY+i,color);
            }
        }

}

