void draw_zoom_box(FrameBuffer& fb, Matriks& map, int s_pos_x, int s_pos_y, int s_draw_x, int s_draw_y) {
    // Assume size SCL_FAC*100x SCL_FAC*200
    const int LENGTH = 400;
    LEN = (LENGTH / SCALING_FACTOR) / 2;

    for (int i = 0; i < LEN; i++) {
        for (int j = 0; j < LEN; j++) {
            if (map.getVal(s_pos_x+j,s_pos_y+i) > 0) {
                for (int k = 0; k < SCALING_FACTOR*2; k++)
                    for (int l = 0; l < SCALING_FACTOR*2; l++)
                        fb.draw_point(s_draw_x+SCALING_FACTOR*2*j+k,s_draw_y+SCALING_FACTOR*2*i+l,&red);
            } else {
                for (int k = 0; k < SCALING_FACTOR*2; k++)
                    for (int l = 0; l < SCALING_FACTOR*2; l++)
                        fb.draw_point(s_draw_x+SCALING_FACTOR*2*j+k,s_draw_y+SCALING_FACTOR*2*i+l,&green);
            }
        }
    }
}

void clear_draw_zoom_box(FrameBuffer& fb, Matriks& map, int s_pos_x, int s_pos_y, int s_draw_x, int s_draw_y) {
    const int LENGTH = 400;
    LEN = (LENGTH / SCALING_FACTOR) / 2;

    for (int i = 0; i < LEN; i++) {
        for (int j = 0; j < LEN; j++) {
            for (int k = 0; k < SCALING_FACTOR*2; k++)
                for (int l = 0; l < SCALING_FACTOR*2; l++)
                    fb.draw_point(s_draw_x+SCALING_FACTOR*2*j+k,s_draw_y+SCALING_FACTOR*2*i+l,&black);
        }
    }
}

void clear_draw_box(FrameBuffer& fb, Matriks& map, int start_x, int start_y, int s_draw_x, int s_draw_y, int len) {\
    int x = start_x - s_draw_x;
    int y = start_y - s_draw_y;

    for (int i = 0; i < len; i++) {

        if (map.getVal(x+i,y) > 0) fb.draw_point(start_x+i,start_y,&red);
        else fb.draw_point(start_x+i,start_y,&green);

        if (map.getVal(x,y+i) > 0) fb.draw_point(start_x,start_y+i,&red);
        else fb.draw_point(start_x,start_y+i,&green);

        if (map.getVal(x+i,y+len-1) > 0) fb.draw_point(start_x+i,start_y+len-1,&red);
        else fb.draw_point(start_x+i,start_y+len-1,&green);

        if (map.getVal(x+len-1,y+i) > 0) fb.draw_point(start_x+len-1,start_y+i,&red);
        else fb.draw_point(start_x+len-1,start_y+i,&green);
    }
}

